import React from "react";
import NavList from "./NavList";

export default function Navbar(props) {
    const ListItem = ["Home",'Categri',"About","Contect"]

    const display = ListItem.map((a,b,c )=>{
        return(
            <>
            <NavList ListItem={a}/>
            </>
        )
    }
    )
  return (
    <>
      <div className="wrapper">
        <h1>{props.title}</h1>
        <ul>
            {display}
        </ul>
      </div>
    </>
  );
}
